import React, {Component} from 'react';
import './Contact.css'
import geoImg from '../../assets/place.svg';
import email from '../../assets/email.svg';
import call from '../../assets/call.svg';
import InfoCircle from './InfoCircle'

import Title from "../Title/Title";
import {Form} from "react-bootstrap";
function Contact(props) {
    const titleTextStyle={
        color:'white',
        padding:'60px 0 50px 0'
    };
    
        return (
            <section className="contact-section">
                <div className="container">
                    <Title style={titleTextStyle} text = "Як зі мною зв'язатися?"/>
                    <div className="contact__inner">
                        <InfoCircle text="м. Рівне, вул. Короленка 5, оф. 216 (2 поверх)" img = {geoImg}/>
                        <InfoCircle text="mshugay@gmail.com" img = {geoImg}/>
                        <InfoCircle text='+380 50 375 45 76 - Марія Шугай \n +380 68 059 81 35 - Іраїда (Менеджер груп)' img = {geoImg}/>
                    </div>
                </div>
            </section>
        );

}

export default Contact;
